import* as React from 'react';
import { ExpandableSection } from '@patternfly/react-core';
import {DormSwitchesList} from "../DormSwitchesList/DormSwitchesList";
import "@patternfly/react-core/dist/styles/base.css";
import "./DormElement.css";
import {FC} from "react";

interface DormElementProps {
    id: string | number;
}

export const DormElement: FC<DormElementProps> = (props) => {
    const [isExpanded, setIsExpanded] = React.useState(false);
    const onToggle = (isExpanded: boolean) => {
        setIsExpanded(isExpanded);
    };

    return (
        <ExpandableSection
            className="dorm"
            toggleText={isExpanded ? `Гуртожиток ${props.id}` : `Гуртожиток ${props.id}` }
            onToggle={onToggle}
            isExpanded={isExpanded}
            displaySize="large"
            isWidthLimited
        >
            <DormSwitchesList/>
        </ExpandableSection>
    );
};
